
CREATE TABLE `eg_organization` (
  `pk` varchar(20) NOT NULL DEFAULT '',
  `id` varchar(20) NOT NULL DEFAULT '',
  `status` varchar(100) DEFAULT NULL,
  `isProvider` char(3) DEFAULT NULL,
  `name` varchar(250) DEFAULT NULL,
  `orgType` varchar(250) DEFAULT NULL,
  `addressPk` varchar(20) DEFAULT NULL,
  `orgURL` varchar(250) DEFAULT NULL,
  `lastUpdatedDate` datetime DEFAULT NULL,
  `lastUpdatedBy` varchar(20) DEFAULT NULL,
  `addressLine1` varchar(250) DEFAULT NULL,
  `addressLine2` varchar(250) DEFAULT NULL,
  `addressLine3` varchar(250) DEFAULT NULL,
  `city` varchar(250) DEFAULT NULL,
  `state` varchar(250) DEFAULT NULL,
  `postalCode` varchar(20) DEFAULT NULL,
  `phone` varchar(20) DEFAULT NULL,
  `fax` varchar(20) DEFAULT NULL,
  `phoneExt` varchar(10) DEFAULT NULL,
  `benefactor` varchar(1000) DEFAULT NULL,
  `JurisdictionalAgency` varchar(50) DEFAULT NULL,
  `County` varchar(200) DEFAULT NULL,
  `PSVENDORID` varchar(14) DEFAULT NULL,
  PRIMARY KEY (`pk`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;


